bio.content:
There are numerous artists with this name, including: 
1) Alba is Franco-Mexican pop singer Alba-Clara Hinojosa; 
2) Alba is a Corsican band; 
3) Alba is a Danish medieval music ensemble founded in 1992; 
4) Alba is Italian entertainer Alba Parietti; 
5) Alba was a Scottish folk group active in the 1970s; 
6) Alba was a German electro trio of Keen K, Michael Künzer, and Roland Faber; 
7) ALBA is Spanish singer, guitarist and songwriter Alba Céspedes; 
8)  ALBA was a German dance outfit from the late 2000s; 
9) Alba is the Russian ethno-trance project of Albert Sultanov; 
10) ALBA is London-based singer-songwriter Alba Ariza; 
11) Alba is an Italian Black Metal/Ambient band; 
12) ALBA is a Kazakhstani soloist under JUZ Entertainment. 

1) Alba is Franco-Mexican pop singer Alba-Clara Hinojosa. As a singer, she performs in English, Spanish and French and has released a five-track EP in 2015, and a nine-track album, Est-ce que t'as vu,  in 2016, 

2) Alba is a Corsican band. The band's debut album, "I soli ciuttati", was released in 1999. 

3) Alba is a Danish medieval music ensemble founded in 1992. The ensemble comprises the duo Agnethe Christensen (voice, kantele) and Poul Høxbro (recorder, percussion), or a trio with addition of the harpist Helen Davis. 

4) Alba was Italian singer (and film actress, television presenter) Alba Parietti (born in Turin, Italy, on 2 July 1961). A former contestant in the Italian Miss Universe contest, she became known in the 1980s with the Italio-Disco Song "Only Music Survives" and the less successful "Jump and Do It" and "Dangerous". 

5) Alba was a Scottish folk group active in the 1970s. Formed in 1975 by Sean O' Rourke, the band released one self-titled album in 1977. Members were Alan Macleod (Highland bagpipes, bodhran), Tony Cuffe[.artist] (guitar, lyre, whistle, vocals), Sean O'Rourke (vocals, bazouki, flute, whistle), and Mike Ward (fiddle, mandolin, guitar, vocals). 

6) Alba was a German electro trio of Keen K, Michael Künzer, and Roland Faber. 

7) ALBA is Spanish singer, guitarist and songwriter Alba Céspedes. 

8)  ALBA was a German dance outfit from the late 2000s.

9) Alba is the Russian ethno-trance project of Albert Sultanov. 

10) ALBA is London-based singer-songwriter Alba Ariza. 

11) Alba is an Italian Black Metal/Ambient band.

12) ALBA is a Kazakhstani soloist under JUZ Entertainment. She debuted on 22vNovember 2018 with the single “TÚNIM” (My Night). Her real name is Albina Nazarbayeva Kazakh (full name Nazarbayeva Bolatkyzy Albina (Назарбаева Болаткызы Альбина); her Russian full name is Albina Bolatovna Nazarbayeva (Альбина Болатовна Назарбаева)). She was born on June 7, 2003.  She is Korean by Nationality. <a href="https://www.last.fm/music/Alba">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.
